  </tr>
  <tr>
    <td>Alfreds Futterkiste</td>
    <td>Maria Anders</td>
    <td>Germany</td>
  </tr>
  
  
</table>

                </div>
            </div>
        );
    }

}

const mapStateToProps = state => {
